import { inject, Injectable } from '@angular/core';
import { RequestFactoryService } from '../httpRequestFactory/request-factory.service';
import { ApiEndpoints } from '../../_models/api-endpoints.enum';
import { tap } from 'rxjs';
import { IBaseResponse } from '../../_models/base-response.model';
import { ITokens } from '../../_models/tokens.model';
import { ILoginDto, IRegisterDto } from '../../_models/DTOs/authDto.model';

@Injectable({
  providedIn: 'root',
})
export class AuthService {
  private requestFactory = inject(RequestFactoryService);

  signIn(loginData: ILoginDto) {
    return this.requestFactory.post<ITokens, ILoginDto>(ApiEndpoints.SIGN_IN, loginData).pipe(
      tap((res: IBaseResponse<ITokens>) => {
        localStorage.setItem('accessToken', res.data.accessToken);
        localStorage.setItem('refreshToken', res.data.refreshToken);
      })
    );
  }

  signUp(registerData: IRegisterDto) {
    return this.requestFactory.post<ITokens, IRegisterDto>(ApiEndpoints.SIGN_UP, registerData).pipe(
      tap((res: IBaseResponse<ITokens>) => {
        localStorage.setItem('accessToken', res.data.accessToken);
        localStorage.setItem('refreshToken', res.data.refreshToken);
      })
    );
  }

  signOut(): void {
    this.requestFactory.post(ApiEndpoints.SIGN_OUT, null);
  }

  resetPassword() {}
  // eslint-disable-next-line @typescript-eslint/no-empty-function
  changePassword() {}
}

import { Injectable } from '@angular/core';
import { FormGroup, FormControl, Validators } from '@angular/forms';
import {
  PasswordsForm,
  LoginForm,
  RegisterForm,
  PasswdRecoveryForm,
  ThemeForm,
} from '../models/form.model';
import { equivalentValidator } from '../validators/equivalent.validator';

@Injectable({
  providedIn: 'root',
})
export class FormService {
  initPasswordsForm(): FormGroup<PasswordsForm> {
    return new FormGroup(
      {
        password: new FormControl('', {
          validators: [Validators.required, Validators.minLength(8), Validators.maxLength(75)],
          nonNullable: true,
        }),
        repeatedPassword: new FormControl('', {
          validators: [Validators.required, Validators.minLength(8), Validators.maxLength(75)],
          nonNullable: true,
        }),
      },
      { validators: [equivalentValidator('password', 'repeatedPassword')] }
    );
  }

  initLoginForm(): FormGroup<LoginForm> {
    return new FormGroup({
      email: new FormControl('', {
        validators: [
          Validators.required,
          Validators.email,
          Validators.minLength(3),
          Validators.maxLength(50),
        ],
        nonNullable: true,
      }),
      password: new FormControl('', {
        validators: [Validators.required, Validators.minLength(8), Validators.maxLength(75)],
        nonNullable: true,
      }),
    });
  }

  initRegisterForm(): FormGroup<RegisterForm> {
    return new FormGroup({
      username: new FormControl('', {
        validators: [Validators.required, Validators.minLength(3), Validators.maxLength(50)],
        nonNullable: true,
      }),
      firstName: new FormControl('', {
        validators: [Validators.required, Validators.minLength(3), Validators.maxLength(50)],
        nonNullable: true,
      }),
      lastName: new FormControl('', {
        validators: [Validators.required, Validators.minLength(3), Validators.maxLength(50)],
        nonNullable: true,
      }),
      email: new FormControl('', {
        validators: [Validators.required, Validators.minLength(3), Validators.maxLength(50)],
        nonNullable: true,
      }),
      password: new FormControl('', {
        validators: [Validators.required, Validators.minLength(8), Validators.maxLength(75)],
        nonNullable: true,
      }),
      confirmPassword: new FormControl('', {
        validators: [Validators.required, Validators.minLength(8), Validators.maxLength(75)],
        nonNullable: true,
      }),
    });
  }

  initThemeForm(): FormGroup<ThemeForm> {
    return new FormGroup({
      theme: new FormControl(false, {
        validators: [Validators.required],
        nonNullable: true,
      }),
    });
  }

  initPasswdRecoveryForm(): FormGroup<PasswdRecoveryForm> {
    return new FormGroup({
      email: new FormControl('', {
        validators: [Validators.required, Validators.email],
        nonNullable: true,
      }),
    });
  }

  getErrorMessage(control: FormControl): string {
    if (control.hasError('required')) {
      return 'Ta kontrolka jest wymagana.';
    }

    if (
      control.hasError('pattern') &&
      control.errors?.['pattern']?.['requiredPattern'] === '/^\\d{2}-\\d{3}$/'
    ) {
      return 'Podano kod pocztowy w niepoprawnym formacie.';
    }

    if (control.hasError('minlength')) {
      return `Minimalna ilo znakw: ${control.errors?.['minlength']?.requiredLength}.`;
    }

    if (control.hasError('maxlength')) {
      return `Maksymalna ilo znakw: ${control.errors?.['maxlength']?.requiredLength}.`;
    }

    if (control.hasError('email')) {
      return `Niepoprawny adres e-mail.`;
    }

    if (control.hasError('passwordsNotEqual')) {
      return 'Hasa musz by takie same.';
    }

    return '';
  }
}

import { HttpClient, HttpHeaders, HttpParams } from '@angular/common/http';
import { inject, Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { environment } from '../../../../environments/environment.development';
import { ApiEndpoints } from '../../_models/api-endpoints.enum';
import { IBaseResponse } from '../../_models/base-response.model';
import { IPagedQueryParams } from '../../_models/paged-query-params.model';
import { IQueryParams } from '../../_models/query-params.model';

@Injectable({
  providedIn: 'root',
})
export class RequestFactoryService {
  private http = inject(HttpClient);

  private getDefaultHeaders(): HttpHeaders {
    return new HttpHeaders({ 'Content-Type': 'application/json' });
  }

  private getDefaultParams(): HttpParams {
    return new HttpParams();
  }

  private request<T, B = undefined>(
    method: string,
    endpoint: ApiEndpoints | string,
    body?: B | null | undefined,
    options?: IQueryParams
  ): Observable<IBaseResponse<T>> {
    const headers = options?.headers ? options.headers : this.getDefaultHeaders();
    const params = options?.params ? options.params : this.getDefaultParams();

    const configuration = {
      headers,
      params,
      body,
    };

    return this.http.request<IBaseResponse<T>>(
      method,
      `${environment.apiURL}/${endpoint}`,
      configuration
    );
  }

  post<T, B>(
    endpoint: ApiEndpoints,
    body: B,
    options?: IQueryParams
  ): Observable<IBaseResponse<T>> {
    return this.request<T, B>('POST', endpoint, body, options);
  }

  getAll<T>(endpoint: ApiEndpoints, options?: IQueryParams): Observable<IBaseResponse<T>> {
    return this.request<T>('GET', endpoint, null, options);
  }

  getById<T>(
    endpoint: ApiEndpoints,
    id: string,
    options?: IQueryParams
  ): Observable<IBaseResponse<T>> {
    return this.request<T>('GET', `${endpoint}/${id}`, null, options);
  }

  getPaged<T>(
    endpoint: ApiEndpoints,
    queryParams: IPagedQueryParams,
    options?: IQueryParams
  ): Observable<IBaseResponse<T>> {
    const pageNumber = queryParams.pageNumber > 0 ? queryParams.pageNumber : 1;
    const pageSize = queryParams.pageSize > 0 ? queryParams.pageSize : 10;

    let params = options?.params ? options.params : this.getDefaultParams();
    params = params.set('pageNumber', pageNumber.toString()).set('pageSize', pageSize.toString());

    if (queryParams.filter) {
      params = params.set('filter', queryParams.filter);
    }

    if (queryParams.sortBy) {
      params = params.set('sortBy', queryParams.sortBy);
    }

    if (queryParams.sortDescending) {
      params = params.set('sortDescending', queryParams.sortDescending.toString());
    }

    if (queryParams.includeInactive) {
      params = params.set('includeInactive', queryParams.includeInactive.toString());
    }

    return this.request<T>('GET', endpoint, null, { params });
  }

  create<T, B>(
    endpoint: ApiEndpoints,
    body: B,
    options?: IQueryParams
  ): Observable<IBaseResponse<T>> {
    return this.request<T, B>('POST', endpoint, body, options);
  }

  update<T, B>(
    endpoint: ApiEndpoints,
    id: string,
    body: B,
    options?: IQueryParams
  ): Observable<IBaseResponse<T>> {
    return this.request<T, B>('PUT', `${endpoint}/${id}`, body, options);
  }

  patch<T, B>(
    endpoint: ApiEndpoints,
    id: string,
    body: B,
    options?: IQueryParams
  ): Observable<IBaseResponse<T>> {
    return this.request<T, B>('PATCH', `${endpoint}/${id}`, body, options);
  }

  delete<T>(
    endpoint: ApiEndpoints,
    id: string,
    options?: IQueryParams
  ): Observable<IBaseResponse<T>> {
    return this.request<T, { isDeleted: number }>(
      'PATCH',
      `${endpoint}/${id}`,
      { isDeleted: 1 },
      options
    );
  }
}

import { Injectable } from '@angular/core';
import { MessageService } from 'primeng/api';
import type { Keys, Severity } from '../types/toast.types';

@Injectable({
  providedIn: 'root',
})
export class ToastService {
  constructor(private messageService: MessageService) {}

  show(severity: Severity, summary: string, detail: string, key?: Keys, life?: number) {
    this.messageService.add({
      severity,
      summary,
      detail,
      key,
      life,
    });
  }

  showSuccess(summary: string, detail: string, key?: Keys, life?: number) {
    this.show('success', summary, detail, key, life);
  }

  showInfo(summary: string, detail: string, key?: Keys, life?: number) {
    this.show('info', summary, detail, key, life);
  }

  showWarning(summary: string, detail: string, key?: Keys, life?: number) {
    this.show('warn', summary, detail, key, life);
  }

  showError(summary: string, detail: string, key?: Keys, life?: number) {
    this.show('error', summary, detail, key, life);
  }

  clear(key?: string) {
    this.messageService.clear(key);
  }
}

