import { CommonModule } from '@angular/common';
import { Component, forwardRef, Input } from '@angular/core';
import {
  ControlValueAccessor,
  FormControl,
  FormsModule,
  NG_VALUE_ACCESSOR,
  ReactiveFormsModule,
} from '@angular/forms';
import { PasswordModule } from 'primeng/password';
import { PasswordInputProps, Variant } from '../../types/password-input.types';

@Component({
  selector: 'app-password-input',
  standalone: true,
  imports: [PasswordModule, CommonModule, ReactiveFormsModule, FormsModule],
  templateUrl: './password-input.component.html',
  styleUrl: './password-input.component.scss',
  providers: [
    {
      provide: NG_VALUE_ACCESSOR,
      useExisting: forwardRef(() => PasswordInputComponent),
      multi: true,
    },
  ],
})
export class PasswordInputComponent<T> implements ControlValueAccessor, PasswordInputProps {
  @Input() label?: string;
  @Input() placeholder?: string = '';
  @Input() disabled = false;
  @Input() required = false;
  @Input() invalid = false;
  @Input() errorMessage?: string;
  @Input() formControl!: FormControl;
  @Input() feedback?: boolean;
  @Input() promptLabel?: string;
  @Input() weakLabel?: string;
  @Input() mediumLabel?: string;
  @Input() strongLabel?: string;
  // @Input() size?: Size;
  @Input() variant: Variant = 'outlined';

  id = `input-${Math.random().toString(36).substr(2, 9)}`;
  touched = false;
  value: T | null = null;

  // eslint-disable-next-line @typescript-eslint/no-unused-vars, @typescript-eslint/no-empty-function
  private onChange = (_value: T) => {};
  onTouched = () => {
    this.touched = true;
  };

  writeValue(value: T): void {
    this.value = value;
  }

  registerOnChange(fn: (value: T) => void): void {
    this.onChange = fn;
  }

  registerOnTouched(fn: () => void): void {
    this.onTouched = fn;
  }

  setDisabledState(isDisabled: boolean): void {
    this.disabled = isDisabled;
  }

  onInput(value: T): void {
    this.value = value;
    this.onChange(value);
  }
}

import { Component, OnInit } from '@angular/core';
import { PasswordInputComponent } from '../../../shared/components/password-input/password-input.component';
import { CommonModule } from '@angular/common';
import { FormControl, FormGroup, FormsModule, ReactiveFormsModule } from '@angular/forms';
import { RouterModule } from '@angular/router';
import { InputComponent } from '../../../shared/components/input/input.component';
import { RegisterForm } from '../../../shared/models/form.model';
import { FormService } from '../../../shared/services/form.service';
import { ButtonComponent } from '../../../shared/components/button/button.component';
import { AuthService } from '../../../core/_services/auth/auth.service';
import { RouterEnum } from '../../../config/router.enum';
import { IRegisterDto } from '../../../core/_models/DTOs/authDto.model';

@Component({
  selector: 'app-register',
  standalone: true,
  imports: [
    ButtonComponent,
    InputComponent,
    ReactiveFormsModule,
    CommonModule,
    PasswordInputComponent,
    RouterModule,
    FormsModule,
  ],
  templateUrl: './register.component.html',
  styleUrl: './register.component.scss',
})
export class RegisterComponent implements OnInit {
  registerForm!: FormGroup<RegisterForm>;
  RouterEnum = RouterEnum;

  constructor(
    private formService: FormService,
    private authService: AuthService
  ) {}

  ngOnInit() {
    this.registerForm = this.formService.initRegisterForm();
  }

  get controls() {
    return this.registerForm.controls;
  }

  getErrorMessage(control: FormControl) {
    return this.formService.getErrorMessage(control);
  }

  onRegister() {
    this.authService.signUp(this.registerForm.getRawValue() as IRegisterDto).subscribe({
      next: res => {
        console.log('Register successful');
        console.log(res);
      },
      error: error => {
        console.error('Register failed');
        console.error(error);
      },
    });
  }
}

